import React from 'react';
import './app/App.css';
import Heade from './components/header/header'; // Asegúrate de que la ruta y el nombre del archivo son correctos
import Hook from './hooks/cards/card';
import Button from './components/button/button';
import Footer from './components/footer/footer';

function App() {
  return (
    <div className='App'>
      <Heade />
      <Hook />
      <Button />
      <Footer />
    </div>
  );
}

export default App;
